	var result = 0;
	var HL7Msg=new String(connectorMessage.getEncodedData());
	var RawHL7Data=HL7Msg.replace(/\'/g,"''");

	var eventDate = $('messageHeader_dateOrTimeOfMessage_timeOfAnEvent');
	var eventDateFormatted = eventDate.substring(4,6) + "/" + eventDate.substring(6,8) + "/" + eventDate.substring(0,4) + " " + eventDate.substring(8,10) + ":" + eventDate.substring(10,12);

	var result = 0;
	var sql = 	"insert EPIC_Beaker.HL7Input(HL7ControlId,dtmHL7EventDate,MRN, HL7Content) " + 
				"values(" + 
